import React from "react";

function Timeline(props) {
  let chirps = props.chirps.map(chirp => {
    return <p key={chirp.chirpId}>{chirp.chirpContent}</p>;
  });
  return <div className="container">{chirps}</div>;
}

export default Timeline;
